('2236','18','7806','Villa biedenbach',Null,'Sehr gepflegte mediterrane Villa in Golfanlage Santa Ponsa','31696','Direkt am Golfplatz II in Nova Santa Ponsa steht diese sehr gepflegte mediterrane Villa in einer beliebten Golfresidence mit Gemeinschaftspool und Hallenbad. Die Villa wurde 2002 erstellt und bietet ca. 195m² Wohnfläche die sich auf 2 Etagen verteilen. Im EG betritt man die Eingangsdiele mit Gäste WC, ein Wohn-Esszimmer, Küche mit Bartresen und ein Schlafzimmer mit Badezimmer en suite.\r\nIm 1. OG befinden sich 2 weitere Schlafzimmer mit je einem Bad en suite und eine Sonnenterrasse. Am Haus angeschlossen gibt es noch 2 separate Abstellräume. Überdachte-und freie Terrassen, ein angelegter pflegeleichter Garten und ein Pool laden zum Entspannen ein. Die richtige Raumtemperatur wird über eine Klimaanlage w/k, Elektroradiatoren in den Bädern und einem Kamin im Wohnzimmer geregelt.\r\nZum Haus gehört noch eine nahe gelegene Tiefgarage mit Kellerraum. \r\n\r\n','31697','890000','106','2014-07-25 15:48:51','106','2014-07-25 15:48:58',Null,'2213','121','1043',1,'1','0',Null,Null,Null,'31698',Null,'0','0','0',Null,'2015-05-04 10:05:15',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31699',Null,'31700',Null,'31701',Null,'31702','Mutter','31703','0',0,'0');
